import React from 'react';
import DataCard from './DataCard';

function Dashboard({
  burnedAmount,
  treasuryAmount,
  royaltiesAmount,
  totalVolume,
  burnedPercentage,
  treasuryPercentage,
  royaltiesPercentage,
  loading,
  lastSync
}) {
  return (
    <main className="dashboard">
      <DataCard
        title="Burned Amount"
        value={burnedAmount}
        unit="PUF"
        percentage={burnedPercentage}
        cardType="burned"
        loading={loading}
        lastSync={lastSync}
      />

      <DataCard
        title="Sent to Treasury"
        value={treasuryAmount}
        unit="PUF"
        percentage={treasuryPercentage}
        cardType="treasury"
        loading={loading}
        lastSync={lastSync}
      />

      <DataCard
        title="Creator Royalties Distributed"
        value={royaltiesAmount}
        unit="WLD"
        percentage={royaltiesPercentage}
        cardType="royalties"
        loading={loading}
        lastSync={lastSync}
        totalVolume={totalVolume}
      />
    </main>
  );
}

export default Dashboard;
